webpackJsonp([0xf927f8900006],{336:function(e,a){e.exports={data:{markdownRemark:{html:"<h1>About me</h1>\n<p>My name is <strong>Henrique Craveiro</strong>, I was born in a small village called Japurá in the interior of Paraná state of Brazil, at present I'm doing a exchange progam in Limerick,Ireland.</p>\n<p>I work for 5 years with web and mobile development, I've worked for the following companies <a href=\"https://brainn.co/\">Brainn.co</a>,  <a href=\"http://virtualage.com.br/\">Virtual Age by Totvs</a>, <a href=\"http://www.marknet.com.br/\">Marknet</a>. In addition I've a degree in software analysis and development and a post graduation in web and mobile developement.</p>\n<p>I love team working, I believe that for a team have success in product development requires good communication, and we must leave individualism aside and try to do what is best for the team.</p>\n<h1>Some skills:</h1>\n<ul>\n<li>JavaScript (ES6/7, Node.js, React, Vue, Angular.js)</li>\n<li>PHP (Zend Framework)</li>\n<li>HTML e Template Languages</li>\n<li>CSS (Stylus, SASS)</li>\n<li>MySQL, MongoDB e SQLServer</li>\n<li>Scrum and Kanban</li>\n</ul>\n<p>I really enjoy programming and I'm very happy to learn, share and create new things every day. I'm curious and I like challenges, if there's something I don't know, I've no problem learning.</p>"}},pathContext:{}}}});
